function validateCheck() {
    $('#edit-form').validate({
        rules: {
            "edit-good-category": {
                required: !0
            },
            "edit-good-code": {
                required: !0
            },
            "edit-good-name": {
                required: !0
            },
            "edit-good-restriction-type": {
                required: !0
            },
            "edit-good-restriction-item": {
                required: !0
            },
            "edit-good-height": {
                required: !0,
                number: !0
            },
            "edit-good-width": {
                required: !0,
                number: !0
            },
            "edit-good-length": {
                required: !0,
                number: !0
            },
            "edit-good-weight": {
                required: !0,
                number: !0
            }
        },
        messages: {
            "edit-good-code": {
                required: "Pleae enter a good code"
            },
            "edit-good-name": {
                required: "Pleae enter a good name"
            },
            "edit-good-category": "Please select a value!",
            "edit-good-restriction-type": "Please select a value!",
            "edit-good-restriction-item": "Please select at least 2 values!",
            "edit-good-height": "Please enter a number!",
            "edit-good-width": "Please enter a number!",
            "edit-good-length": "Please enter a number!",
            "edit-good-weight": "Please enter a number!"
        }
    });

    $('#create-form').validate({
        rules: {
            "good-category": {
                required: !0
            },
            "good-code": {
                required: !0
            },
            "good-name": {
                required: !0
            },
            "good-restriction-type": {
                required: !0
            },
            "good-restriction-item": {
                required: !0
            },
            "good-height": {
                required: !0,
                number: !0
            },
            "good-width": {
                required: !0,
                number: !0
            },
            "good-length": {
                required: !0,
                number: !0
            },
            "good-weight": {
                required: !0,
                number: !0
            }
        },
        messages: {
            "good-code": {
                required: "Pleae enter a good code"
            },
            "good-name": {
                required: "Pleae enter a good name"
            },
            "good-category": "Please select a value!",
            "good-restriction-type": "Please select a value!",
            "good-restriction-item": "Please select at least 2 values!",
            "good-height": "Please enter a number!",
            "good-width": "Please enter a number!",
            "good-length": "Please enter a number!",
            "good-weight": "Please enter a number!"
        }
    });

    $('#good-code').on('keyup', function() {
        if ($('#good-code').val() == "") {
            $('#create').removeAttr('disabled');
        } else {
            $('#create').attr('disabled', true);
            $.ajax({
                url: "/vehicle-management/validation-vehicle",
                type: 'POST',
                data: {
                    key: "Good Code",
                    value: $(this).val()
                },
                success: function(response) {
                    if(response == "200") {
                        $('#create').removeAttr('disabled');
                        if (!$('#good-code-error-db').hasClass('d-none')) {
                            $('#good-code-error-db').addClass('d-none'); 
                        }
                    } else {
                        $('#good-code-error-db').removeClass('d-none');
                    }
                },
                error: function() {
                    alert("Data not found");
                }
            }); 
        }
    });

    $('#good-name').on('keyup', function() {
        if ($('#good-name').val() == "") {
            $('#create').removeAttr('disabled');
        } else {
            $('#create').attr('disabled', true);
            $.ajax({
                url: "/vehicle-management/validation-vehicle",
                type: 'POST',
                data: {
                    key: "Good Name",
                    value: $(this).val()
                },
                success: function(response) {
                    if(response == "200") {
                        $('#create').removeAttr('disabled');
                        if (!$('#good-name-error-db').hasClass('d-none')) {
                            $('#good-name-error-db').addClass('d-none'); 
                        }
                    } else {
                        $('#good-name-error-db').removeClass('d-none');
                    }
                },
                error: function() {
                    alert("Data not found");
                }
            }); 
        }
    });

    
}